Certainly! Here are several lines from the poem:

1. But wherefore do not you a mightier way
2. Nor thou with public kindness honour me,
3. To give away yourself keeps yourself still,
4. And often is his gold complexion dimm'd;
5. The world will wail thee, like a makeless wife;
6. Delights to peep, to gaze therein on thee;
7. Sets you most rich in youth before my sight,
8. Which in thy breast doth live, as thine in me:
9. But out, alack! he was but one hour mine;
10. And, constant stars, in them I read such art
11. Within thine own bud buriest thy content
12. O, let my books be then the eloquence
13. By chance or nature's changing course untrimm'd;
14. But beauty's waste hath in the world an end,
